INSERT INTO `book` VALUES (1,'9788587781314','Senhores da Escuridão','Trilogia O Reino das Sombras','teste',NULL,NULL,2008,698,2,2,4),(2,'9788587781320','Evangelho Segundo Espiritismo','Evangelho','Filosofia e Religiao',NULL,NULL,1935,467,2,2,2),(3,'9788587781500','Caminhos da Verdade','Livro mediunico','livro mediunico',NULL,NULL,1983,300,3,3,5),(4,'978-85-7328-109-5','Loucura e Obsessão','Loucura e Obsessão','Loucura e obsessão : Estuda a presença da obsessão na maioria dos casos de animosidades',NULL,NULL,2007,334,4,2,6),(5,'858903801-7','Mereça Ser Feliz','Superando as Ilusoes do Orgulho','As anotaçoes desse volume desprentecioso foram espirados no curso de vintre dias que realizamos no hospital esperança sob a direção de Balsanulf 2 edição',NULL,NULL,2003,186,5,4,7),(6,'9788560628186','100 ANOS DE CHICO XAVIER','','Fenômeno Humano e Mediúnico\r\n\r\n \r\n\r\nNesta obra publicada em comemoração ao centenário de nascimento de Chico Xavier (1910-2010), Carlos A. Baccelli coloca no papel, em sequência histórica, a vida desse ser humano ímpar, que soube como ninguém dar exemplos para o mundo. Esta não é uma biografia definitiva da vida de Chico Xavier - a sua vida prodigiosa não caberia em um único livro! -, mas com certeza é uma das mais completas.  COD 1651 - TOMBO: 716\r\n',NULL,NULL,1980,464,6,5,8),(7,'9788561879075','100 REFLEXÕES FILOSÓFICAS','e Cor Local nos Romances Mediúnicos de Victor Hugo','Trata-se de inserção de comentários e considerações extremamente oportunas sobre os mais variados temas, todos de grande interesse. Nessas profundas e sábias reflexões, o mestre Victor Hugo transmite-nos - com seu inconfundível e magistral estilo literário - lições de grande utilidade para o nosso aprendizado doutrinário, \r\nfacultando-nos a oportunidade de aprimoramento moral e espiritual.\r\n',NULL,NULL,2009,304,4,225,9),(8,'978-85-63365-79-8','1/3 DA VIDA','','O que seria da saúde do homem no corpo físico sem a energia vital absorvida durante o sono? Como a mente encontraria soluções para seus desafios sem o encontro noturno com seus tutores amoráveis? Como dissolver a sombra da obsessão e da tormenta sem esses breves períodos de luz nos planos espirituais?\r\n\r\nA emancipação da alma desnuda as mais profundas verdades sobre o ser. Sair do corpo a cada noite é o mesmo que se olhar no espelho da realidade para não nos esquecermos de nossas necessidades mais profundas.\r\n\r\nA atividade noturna fora da matéria representa um terço da vida no corpo físico e é considerada por nós como o período mais rico em espiritualidade, oportunidade e esperança.\r\n\r\nSem dúvida, enquanto o corpo dorme a alma desperta.',NULL,NULL,2009,279,5,113,6),(9,'978-8577220953','20 CASOS SUGESTIVOS DE REENCARNAÇÃO','','Ian Stevenson apresenta casos intrigantes de pessoas que se recordam de suas vidas passadas em países como Índia, Alasca, Líbano e Brasil.',NULL,NULL,2010,520,9,350,3),(10,'7000000028489','50 MISSIVAS','','É muito bom receber cartas. Neste volume, encontramos 50 cartas que o espírito Miramez ditou à pena mediúnica de João Nunes Maia. Uma delas, sem qualquer dúvida, terá sido destinada a nós!',NULL,NULL,2009,208,477,171,5),(11,'230','52 LIÇÕES DE CATECISMO ESPÍRITA','Espiritismo','52',NULL,NULL,1981,116,11,281,2),(12,'2952','A 2ª MORTE','Vida no Além','A Segunda Morte é uma informação que aparece no Apocalipse. O livro traz novas informações das Regiões Desconhecidas do Espírito, que virão ampliar o conhecimento daqueles que estudam e procuram entender. Livro escrito sob orientação de André Luiz, pelo Espírito de Altino, com tradução espiritual do Autor.',NULL,NULL,2009,144,640,128,5),(13,'1172','A ALMA É IMORTAL','','Nesta edição você encontrará o livro A Alma é Imortal, nele o sábio Gabriel Delanne, um dos vultos exponenciais do espiritismo nascente, relata casos extraordinários, analisa-os com raciocínio científico, e conclui: é a verdade se mostrando na sua esplêndida evidência; sim, nós temos uma alma imortal, e as vidas sucessivas são uma realidade incontestável. E tudo isso não é especulação filosófica: são fatos, reproduzidos às',NULL,NULL,2015,333,14,NULL,3),(14,'7000000081118','A ALMA EM DEPRESSÃO','','Retrata um apanhado prático e teórico do transtorno psicopatógico de maior incidência na vivência clínica na área da saúde mental. O livro tem por objetivo agregar à etiologia, diagnóstico e plano de trabalho uma nova visão do homem e de sua doença.Alicerçada nas bases do reconhecimento das funções biológicas e mentais, bem como na identificação, análise, definição e funcionalidade da estrutura espiritual do ser, encarnado ou não. O autor pretende complementar as ciências da saúde mental à ciência espiritualista em seus aspectos tangíveis e essenciais.',NULL,NULL,2019,168,15,189,7),(15,'978-1544268132','A ARTE DE AMAR','também viram','A maioria das pessoas consegue desenvolver sua capacidade de amar no unico nivel que realmente importa - um amor constituido por maturidade, autoconhecimento e coragem. O aprendizado do amor, com o de todas as outras artes, exige pratica e concentracao. E, mais do que qualquer outra arte, exige insight e compreensao. Neste livro surpreendente, o dr. Fromm aborda o amor sob todos os seus aspectos - nao apenas o amor romantico, tao cercado de conceitos erroneos, mas tambem o amor dos pais pelos filhos, entre irmaos o amor erotico, o amor-proprio e o amor a Deus.',NULL,NULL,2017,146,16,213,4),(16,'978-8576182481','A ASCENSÃO DO ESPIRITISMO DE A  A  Z','CONHECIMENTO1601','Aprendendo com Ramatís é uma coletânea de textos que nos remete ao âmago dos ensinamentos deste verdadeiro arauto da luz sobre a sublime peregrinação do espírito imortal através de incontáveis romagens, ora em planos densos, ora em dimensões mais sutis, sempre aprendendo e crescendo em intelectualidade e moralidade, a fim de adquirir a consciência cósmica que o torna um “filho de Deus” a auxiliar os irmãos menores que',NULL,NULL,2011,584,17,93,2),(17,'978-8500113338','A AURA HUMANA','O livro que revelou Gore Vidal','Baseando-se nessa tradição milenar, o Dr. Walter John Kilner concebeu a ideia de que, mediante certos dispositivos, a aura humana pode tornar-se visível a praticamente todas as pessoas dotadas de visão normal.',NULL,NULL,1992,231,18,289,3),(18,'441998','A Bíblia e Seus Absurdos','Em busca da verdade','Capas com marcas de dobradura. Capas e lombada um pouco gastas, principalmente nas bordas. Manchas do tempo no corte. Miolo em bom estado. Assinatura de antigo dono na folha de rosto. .\r\nEtiqueta de Identificação na Contracapa.',NULL,NULL,1999,90,20,335,7),(19,'9788585685188','A BATALHA FINAL','','Todo o povo de Deus deve estar preparado para enfrentar a batalha final entre a luz e as trevas praticando as escrituras e crescendo espiritualmente.',NULL,NULL,1999,312,19,326,7),(20,'978-8588477674','A BIOLOGA DA CRENÇA','','Este livro vai mudar sua vida: novas e surpreendentes descobertas científicas demonstram que as células do corpo são influenciadas pelo nosso pensamento e ajudam a comprovar a reencarnação. O cientista Bruce Lipton, renomado biólogo norte-americano,descreve as reações químicas do processo celular e comprova cientificamente suas descobertas que revolucionaram a Biologia. Best-seller nos',NULL,NULL,2007,256,21,45,7),(21,'128','A CAMINHO DA LUZ','Coleção Emmanuel','Objetivando orientar o homem de acordo com os desígnios da Misericórdia divina, apresentando reflexões sobre as situações cotidianas à guisa dos ensinamentos e bondade celestes, A caminho da luz é obra merecedora de leitura e estudo para os que buscam compreender nosso mundo.  Nesta inestimável obra, o Espírito Emmanuel narra a história da humanidade sob a luz do Espiritismo',NULL,NULL,2013,210,22,2,7),(22,'9788570460165','A CAMINHOS DE VOLTA','DIVERSOS ESPIRITOS','A inspirada capa do livro define com clareza de que modo os autores espirituais veem os caminhos de volta para recuperarmos a paz no coração, a esperança e a tranquilidade espiritual decorrentes dos duros embates da vida. São caminhos tortuosos, mas forrados de flores em suas margens.',NULL,NULL,1999,124,40,179,7),(23,'978-8573286618','A CARAVANA DA FRATERNIDADE','','Após a instalação do Conselho Federativo Nacional da Federação Espírita Brasileira, na sede da FEB, a lº de janeiro de 1950 — como desdobramento do Pacto Áureo —, havia a necessidade de se contar com o apoio e a participação dos estados que não haviam firmado o histórico documento. Nesta obra, Leopoldo Machado relata a histórica viagem aos estados do Norte e do Nordeste do país, realizada entre outubro e dezembro de 1950. Este movimento de aproximação, conhecido como “Caravana da Fraternidade”, foi organizado por alguns signatários do Pacto Áureo. Os caravaneiros Artur Lins de Vasconcelos (PR), Carlos Jordão da Silva (SP), Francisco Spinelli (RS), Ary Casadio (SP) e Leopoldo Machado (BA)',NULL,NULL,2012,372,41,158,7),(24,'978-8571563223','A CARTILHA DA VIDA','','',NULL,NULL,2003,135,42,319,9),(25,'978-8560451029','A CASA DO CAMINHO E OS PRIMEIROS CRISTÃOS','','O Catarismo foi um dos mais bem articulados movimentos ideológicos da história. Iniciado em torno do ano 1000, expandiu-se rapidamente pelo sul da Europa, onde suas propostas, que consistiam basicamente num retorno à pureza da herança cultural do Cristo, sem as deformações que tanto o descaracterizavam, foram bem aceitas. Sofreu, contudo, tenaz perseguição da Igreja, especialmente da tenebrosa Inquisição, que o levou à extinção. Numa leitura do problema cátaro, esse livro',NULL,NULL,2019,256,43,125,7),(26,'978-8571560284','A CHAVE DA VIDA FELIZ','VOLUME 2','',NULL,NULL,2002,163,42,319,9),(27,'978-8573743197','A CIDADE DOS ESPIRITOS',' A vida no mundo espiritual','Se você tem um sonho, um sonho autenticamente seu, persiga-o, mas se não tiver tanta certeza assim, leia este livro. É a oportunidade de decidir o que é importante para você, sem ficar perdendo tempo com os sonhos que os outros sonharam para você. Pode até ser doloroso descobrir que o sonho de ser médico era, na verdade, de seus pais ou de quem quer que seja, e não o seu, mas... antes agora do que mais tarde! E mesmo estando no caminho certo - aquele escolhido por você - há',NULL,NULL,2000,112,44,250,7),(28,'2183','A CIENCIA DO BOM VIVER','','A saúde é um dos principais fatores de preocupação, condicionamento e realização do ser humano. Ter uma boa saúde é uma aspiração e um objetivo universais, mas os meios para a alcançar nem sempre são conhecidos ou nem sempre são eficazes e adequados. Neste livro, Ellen White trata da doença nas suas múltiplas facetas – física, mental, emocional, social e espiritual – e propõe,',NULL,NULL,2015,531,45,673,4),(29,'7000000036415','A CIÊNCIA DO ESPÍRITO','','Este livro contém o resultado de mais de trinta anos de pesquisas sobre assuntos como: Prcepção extra-sensorial, Psicocinesia, Fenômeno mediúnico, Perisppírito, Ciência do biorritmo, dentre outros.',NULL,NULL,1999,240,46,91,3),(30,'1184','A CLARIVIDÊNCIA','','Um clássico da literatura esotérica, enriquecido com 18 imagens, escrito há mais de cem anos por Charles Webster Leadbeater, um destacado membro do movimento teosófico que também foi um clarividente experimentado. Nesta obra a clarividência, ou seja, a capacidade de ver e ouvir o que ocorre nos planos sutis que estão a nossa volta, é abordada de forma prática e objetiva, incluindo uma análise de como acontece a clarividência do passado e do futuro e qual o melhor método para desenvolvê-la. Veja o índice de Matérias: 1) Notas Biográficas sobre o autor, 2) O que é a Clarividência, 3) Clarividência Simples: Completa, 4) Clarividência Simples: Parcial, 5) Clarividência no Espaço: Intencional, 6) Clarividência no Espaço: Semi-Intencional, 7) Clarividência no Espaço: Não-Intencional, 8) Clarividência no Tempo : O Passado, 9) Clarividência no Tempo : O Futuro, 10) Métodos de Desenvolvimento.',NULL,NULL,2013,120,217,289,4),(31,'935','A CIENCIA PRANAYAMA','','FILOSOFICO',NULL,NULL,1999,100,47,289,4),(32,'1485','A CODIFICAÇ